import React, { useState, useEffect, useMemo } from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { Card, CardContent, CardHeader, CardTitle, CardDescription } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Loader2 } from 'lucide-react';

function App() {
  const [data, setData] = useState(null);
  const [nextPage, setNextPage] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchData('http://localhost:8000/candidate_test/fronted/');
  }, []);

  const fetchData = async (url) => {
    setIsLoading(true);
    try {
      const response = await fetch(url);
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const responseData = await response.json();
      setData(prevData => {
        if (prevData) {
          return {
            ...responseData,
            results: { ...prevData.results, ...responseData.results }
          };
        }
        return responseData;
      });
      setNextPage(responseData.next);
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Failed to fetch data. Please try again later.');
    } finally {
      setIsLoading(false);
    }
  };

  const loadMore = () => {
    if (nextPage) {
      fetchData(nextPage);
    }
  };

  const processedData = useMemo(() => {
    if (!data) return [];

    const processedData = [];
    Object.entries(data.results).forEach(([year, months]) => {
      Object.entries(months).forEach(([month, entries]) => {
        let totalValue = 0;
        entries.forEach(entry => {
          const [, value] = Object.entries(entry)[0];
          totalValue += value;
        });
        processedData.push({
          date: `${year}-${month}`,
          value: totalValue
        });
      });
    });
    return processedData.sort((a, b) => a.date.localeCompare(b.date));
  }, [data]);

  if (isLoading && !data) {
    return (
      <div className="flex items-center justify-center h-screen">
        <Loader2 className="w-8 h-8 animate-spin text-blue-500" />
      </div>
    );
  }

  if (error) {
    return (
      <Card className="max-w-md mx-auto mt-8 bg-red-50">
        <CardContent className="pt-6">
          <p className="text-red-500">{error}</p>
        </CardContent>
      </Card>
    );
  }

  return (
    <div className="container mx-auto p-4">
      <Card className="w-full shadow-lg">
        <CardHeader className="bg-gradient-to-r from-blue-500 to-purple-500">
          <CardTitle className="text-2xl font-bold text-white">Timestamped Values</CardTitle>
          <CardDescription className="text-blue-100">Monthly data visualization</CardDescription>
        </CardHeader>
        <CardContent className="pt-6">
          {data && (
            <>
              <div className="h-[400px] w-full">
                <ResponsiveContainer width="100%" height="100%">
                  <BarChart data={processedData}>
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="date" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                    <Bar dataKey="value" fill="#8884d8" />
                  </BarChart>
                </ResponsiveContainer>
              </div>
              {nextPage && (
                <div className="mt-4 text-center">
                  <Button 
                    onClick={loadMore} 
                    disabled={isLoading}
                    className="bg-blue-500 hover:bg-blue-600 text-white"
                  >
                    {isLoading ? (
                      <>
                        <Loader2 className="mr-2 h-4 w-4 animate-spin" />
                        Loading...
                      </>
                    ) : (
                      'Load More'
                    )}
                  </Button>
                </div>
              )}
            </>
          )}
        </CardContent>
      </Card>
    </div>
  );
}

export default App;
